  false,\n\t\"url\": null,\n\t\"notes\": \"The Lower Souris Migratory Waterfowl Refuge
  (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
  of the Canadian border in North Dakota. The refuge was established and constructed
  by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
  events taking place on the refuge in May, June and July of 1939. The table of contents
  of this report includes sections on personnel, wildlife, refuge development and
  maintenance, public relations, economic uses and photographs.\",\n\t\"license_title\":
